import { Button } from "bootstrap";
import React from "react";

function Dashboard() {
  return (
    <div class="btn-group-vertical">

            <button className="nav-link mt-5" >Villes</button>
            <button className="nav-link mt-5" >Zones</button>
            <button className="nav-link mt-5" >Restaurants</button>
            <button className="nav-link mt-5" >Utilisateurs</button>
    </div>
  );
}

export default Dashboard;
